pragma solidity ^0.4.21;

import "./zeppelin/Ownable.sol";
import "./zeppelin/SafeMath.sol";


contract Certificate is Ownable {

    using SafeMath for uint256;

    struct Cert {
        bytes32 url;
        uint256 amount;
        uint256 timestamp;
    }

    uint256 public reserves = 0;
    Cert[] certificates;

    function addCertificate(bytes32 _url, uint256 _amount) public onlyOwner {
        Cert memory certificate = Cert({
            url: _url,
            amount: _amount,
            timestamp: now
        });

        reserves = reserves.add(certificate.amount);

        certificates.push(certificate);
    }

    function getCertificatesLength() public constant onlyOwner returns (uint) {
        return certificates.length;
    }

    function getCertificate(uint256 _index) public constant onlyOwner returns (bytes32, uint, uint) {
        Cert memory certificate = certificates[_index];
        return (
            certificate.url,
            certificate.amount,
            certificate.timestamp
        );
    }

    function deleteCertificate(uint256 _index) public onlyOwner {
        require(certificates[_index].amount >= 0);

        reserves = reserves.sub(certificates[_index].amount);

        certificates[_index] = certificates[certificates.length-1];
        certificates.length--;
    }

}
